angular.module("html/help.html",[]).run(["$templateCache",function(b){b.put("html/help.html",'<div class="container"><h3>T\u1ea1i sao ph\u1ea3i \u0111\u0103ng k\u00fd?</h3><ul><li>- \u0110\u0103ng k\u00fd b\u1ea1n c\u00f3 th\u1ec3 nhi\u1ec1u quy\u1ec1n l\u1ee3i h\u01a1n, ho\u00e0n to\u00e0n mi\u1ec5n ph\u00ed</li></ul><h3>Quy\u1ec1n l\u1ee3i \u0111\u0103ng k\u00fd nh\u01b0 th\u1ebf n\u00e0o?</h3><ul><li>- B\u1ea1n c\u00f3 th\u1ec3 tham gia th\u1ea3o lu\u1eadn, ch\u01a1i tr\u00f2 ti\u00ean \u0111o\u00e1n tr\u01b0\u1edbc k\u1ebft qu\u1ea3 v\u00e9 s\u1ed1. N\u1ebfu tr\u00fang b\u1ea1n s\u1ebd t\u0103ng s\u1ed1 l\u01b0\u1ee3ng b\u1ea1c, m\u1ed7i ng\u00e0y b\u1ea1n c\u00f3 th\u1ec3 ch\u01a1i... h\u1ebft b\u1ea1c th\u00ec v\u1eabn ch\u01a1i n\u1ee3.</li><li>- Nh\u1eadn v\u00e0ng t\u1eb7ng c\u1ee7a th\u00e0nh vi\u00ean kh\u00e1c, 1 v\u00e0ng t\u01b0\u01a1ng \u0111\u01b0\u01a1ng 1.000 \u0111\u1ed3ng.</li><li>- Khi \u0111\u1ee7 500 v\u00e0ng, b\u1ea1n c\u00f3 th\u1ec3 y\u00eau c\u1ea7u r\u00fat th\u00e0nh ti\u1ec1n qua c\u00e1c ng\u00e2n h\u00e0ng Vi\u1ec7t Nam sau khi Qu\u1ea3n tr\u1ecb vi\u00ean ki\u1ec3m tra kh\u00f4ng c\u00f3 h\u00e0nh vi gian l\u1eadn.</li></ul><h3>T\u1ea1i sao th\u00e0nh vi\u00ean kh\u00e1c t\u1eb7ng v\u00e0ng cho t\u00f4i?</h3><ul><li>- Khi b\u1ea1n c\u00f3 l\u01b0\u1ee3t ch\u01a1i th\u1eafng cao... th\u00e0nh vi\u00ean kh\u00e1c s\u1ebd t\u1eb7ng v\u00e0ng cho b\u1ea1n \u0111\u1ec3 xem b\u1ea1n \u0111ang ch\u01a1i s\u1ed1 g\u00ec?</li><li>- Khi b\u1ea1n ch\u01a1i b\u1eb1ng b\u1ea1c, khi s\u1ed1 b\u1ea1n tr\u00fang gi\u1ea3i n\u1eb1m \u1edf trong TOP 3 s\u1ed1 \u0111\u1ea7u b\u1ea3ng... s\u1ed1 v\u00e0ng t\u1eb7ng t\u00f9y theo l\u01b0\u1ee3ng ng\u01b0\u1eddi \u0111\u00f3ng g\u00f3p TIP v\u00e0 chia \u0111\u1ec1u c\u00e1c th\u00e0nh vi\u00ean kh\u00e1c c\u00f9ng tr\u00fang gi\u1ea3i.</li></ul><h3>T\u1ea1i sao ch\u01a1i th\u1eed v\u1eabn c\u00f3 ti\u1ec1n?</h3><ul><li>- Ban Qu\u1ea3n Tr\u1ecb s\u1ebd thu v\u00e0ng \u1edf ph\u1ea7n b\u00e1n v\u00e9 TIP \u0111\u1ec3 t\u1eb7ng cho c\u00e1c th\u00e0nh vi\u00ean \u0111\u00f3ng g\u00f3p c\u00f3 tr\u00fang gi\u1ea3i... \u0111\u1ed3ng th\u1eddi Ban Qu\u1ea3n Tr\u1ecb s\u1ebd gi\u1eef 10% \u0111\u1ec3 l\u00e0m kinh ph\u00ed ho\u1ea1t \u0111\u1ed9ng</li></ul><h3>T\u00f4i c\u00f3 c\u1ea7n n\u1ea1p v\u00e0ng kh\u00f4ng?</h3><ul><li>- KH\u00d4NG, N\u1ea1p v\u00e0ng khi b\u1ea1n c\u00f3 nhu c\u1ea7u d\u00f9ng v\u00e0ng \u0111\u1ec3 t\u1eb7ng cho th\u00e0nh vi\u00ean kh\u00e1c ho\u1eb7c mua TIP.</li></ul><h3>R\u00fat v\u00e0ng ra nh\u01b0 th\u1ebf n\u00e0o?</h3><ul><li>- Khi b\u1ea1n \u0111\u1ea1t m\u1ee9c 500 v\u00e0ng, s\u1ebd hi\u1ec3n th\u1ecb n\u00fat \u201cr\u00fat v\u00e0ng\u201d, b\u1ea1n b\u1ea5m n\u00fat r\u00fat v\u00e0ng.</li><li>- Khi r\u00fat v\u00e0ng t\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n ph\u1ea3i c\u1eadp nh\u1eadp s\u1ed1 \u0111i\u1ec7n tho\u1ea1i v\u00e0 s\u1ed1 t\u00e0i kho\u1ea3n nh\u1eadn ti\u1ec1n \u1edf ng\u00e2n h\u00e0ng Vi\u1ec7t Nam... khuy\u00ean d\u00f9ng Vietcombank</li><li>- Th\u1eddi gian nh\u1eadn ti\u1ec1n 2-4 ng\u00e0y l\u00e0m vi\u1ec7c.</li></ul><h3>T\u00f4i d\u00f9ng v\u00e0ng \u0111\u1ec3 l\u00e0m g\u00ec?</h3><ul><li>- B\u1ea1n d\u00f9ng v\u00e0ng c\u00f3 th\u1ec3 mua v\u00e9 TIP</li><li>- T\u1eb7ng cho th\u00e0nh vi\u00ean kh\u00e1c</li><li>- Mua v\u00e9 s\u1ed1 online tr\u00ean \u1ee9ng d\u1ee5ng...(ph\u1ea3i c\u1eadp nh\u1eadp s\u1ed1 \u0111i\u1ec7n tho\u1ea1i trong t\u00e0i kho\u1ea3n). N\u1ebfu v\u00e9 tr\u00fang s\u1ebd chuy\u1ec3n ti\u1ec1n v\u00e0o t\u00e0i kho\u1ea3n ng\u00e2n h\u00e0ng c\u1ee7a b\u1ea1n ngay. S\u1ed1 \u0111i\u1ec7n tho\u1ea1i ph\u1ea3i ch\u00ednh x\u00e1c, s\u1ebd c\u00f3 ng\u01b0\u1eddi li\u00ean h\u1ec7 \u0111\u1ec3 th\u00f4ng b\u00e1o chuy\u1ec3n ti\u1ec1n.</li></ul></div>')}]);
